import React from "react";
import Mycompo from "./Mycomponent/Mycompo";
import Mycom2 from "./Mycomponent/Mycom2";
import Mycomlist from "./Mycomponent/Mycomlist";


function Myapp(){
    return (
        <>
        <Mycompo/>,
        <Mycom2/>,
        <Mycomlist/>
        </>
    );
    
}
export default Myapp;
